import React from "react"
import Link from "next/link"

// import "./layout.css";

class Layout extends React.Component {
    state = { };

    render() {
        return (
            <div>
                <style jsx>{`
                    Link {
                        background: grey;
                    }
                    a {
                        background: green;
                    }
                `}</style>
                <nav>
                    <ul>
                        <Link href="/">
                            <a>Home</a>
                        </Link>
                        <Link href="/about">
                            <a>About</a>
                        </Link>
                    </ul>
                </nav>
                <main>
                    {this.props.children}
                </main>
            </div>
        );
    }
}

export default Layout;
